{"title":"gitlab_merge_requests_efficiency_help","type":"markdown","params":{"fontSize":10,"markdown":"This panel focuses on **solved** (merged OR closed) GitLab merge requests.

**REI**: Review Efficiency Index, defined as the number of solved merge requests divided by the number of open ones in a given period of time. Measures efficiency solving merge requests.

**Lead time**: the time expressed in days between the initiation and completion of a production process, in this case, a merge request. Shown in average."},"aggs":[]}
